var util           = require("util");
var ResponseHeader = require("../response");

function TransferEncodingHeader(value) {
    ResponseHeader.call(this, value);
}

util.inherits(TransferEncodingHeader, ResponseHeader);

TransferEncodingHeader.prototype.getKey = function() {
    return "Transfer-Encoding";
};

module.exports = TransferEncodingHeader;
